import React from 'react';

function AgentCard({ role, emoji }) {
  return (
    <div style={styles.card}>
      <h3>{emoji} {role} Agent</h3>
      <div style={styles.chatBox}>对话区</div>
      <input type="text" placeholder="输入消息..." style={styles.input} />
    </div>
  );
}

const styles = {
  card: {
    border: '1px solid #ddd',
    borderRadius: 10,
    padding: 15,
    width: 200,
    textAlign: 'center',
    background: 'white',
    boxShadow: '0 2px 8px rgba(0,0,0,0.05)'
  },
  chatBox: {
    height: 100,
    background: '#f9f9f9',
    margin: '10px 0',
    padding: 10,
    borderRadius: 5
  },
  input: {
    width: '100%',
    padding: 8
  }
};

export default AgentCard;
